import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";
import Person from "./Pages/Person/Person";
import ThakiJa from ''
 const mapRoutes = {
    "clue1" : <Clue1 /> ,
    "jiya": <Person textFileName={'jiya'} personName={'Jiya'} />,

    "clue2" : <Clue2 />, 
    "saloni": <Person2 textFileName={'saloni'} personName={'Saloni'} />,

    "clue3" : <Clue3 />, 
    "krish": <Person3 textFileName={'krish'} personName={'Krish'} />, 

    "clue4" : <Clue4 />,
    "dhara": <Person4 textFileName={'dhara'} personName={'Dhara'} />, 

    "clue5" : <Clue />, 
    "sarjana": <Person textFileName={'sarjana'} personName={'Sarjana'} />, 

    "clue6" : <Clue />, 
    "viha": <Person textFileName={'viha'} personName={'Viha'} />, 

    "clue7" : <Clue />, 
    "riza": <Person textFileName={'riza'} personName={'Riza'} />, 

    "clue8" : <ThakiJa />, 
  }

  const routeList = [];

  routeList.push(
    <Route path="/" element={<Home />} />
  )
  let str = "/"
  Object.entries(mapRoutes).forEach(([clueName, listDetais], index) => {
    str += clueName + '/'
    routeList.push(
      <Route path={str} element={listDetais[0]} />
    )
  });
function App() {
  return (
      <BrowserRouter>
      <Routes>
        {routeList}
      </Routes>
    </BrowserRouter>
  );
}

export default App;
